class Pokedata {
    constructor(nom, hp, atk, def, atkSpe, defSpe, speed, id, type, weight, height) {
      this.nom = nom;
      this.atk = atk;
      this.atkSpe = atkSpe;
      this.def = def;
      this.defSpe = defSpe;
      this.hp = hp;
      this.type = type;
      this.atidk = id;
      this.speed = speed;
      this.weight = weight;
      this.height = height;
      this.image = null;
    }
  }
